SELECT COALESCE(FIRST_VALUE("ps_suppkey") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), FIRST_VALUE("ps_suppkey") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING)) AS "PS_SUPPKEY", "ps_partkey" AS "ps_partkey0"
FROM "TPCH"."partsupp"
GROUP BY FIRST_VALUE("ps_partkey") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), FIRST_VALUE("ps_suppkey") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), FIRST_VALUE("ps_availqty") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), FIRST_VALUE("ps_supplycost") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), FIRST_VALUE("ps_comment") OVER (PARTITION BY "ps_partkey" RANGE BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING), "ps_partkey"